de:
Willkommen in der Gîte d'En Lébé in Touget, im Herzen der Gascogne

Dieses große, 290 m2 große Gebäude befindet sich auf dem landwirtschaftlichen Betrieb und wurde nach den Grundsätzen des "Bauens mit Charakter" renoviert

Mit viel Komfort werden Sie die geräumigen und ausgestatteten Wohnräume schätzen: die große Eingangshalle, das Wohnzimmer mit Kamin (im Winter mit möglichem Flambieren), die separate Küche und die Waschküche mit eigener Waschmaschine...

Die 5 Zimmer, alle mit Klimaanlage, bieten Platz für bis zu 17 Personen:
- le Chai (mit dem Label Tourisme et Handicap): zwei Einzelbetten (90 cm), eigene Sanitäranlagen (Waschbecken, Dusche, WC);
- la Réserve: ein Bett (140 cm), private Sanitäranlagen (Waschbecken, Dusche, WC);
- le Poulailler : ein Bett 140 cm, private Sanitäranlagen (Waschbecken, Dusche, separates WC);
- taubenschlag: 1 Einzelbett (90 cm) und 1 Einzelbett (120 cm);
- dachboden: 8 Einzelbetten (90 cm), private Sanitäranlagen (4 Waschbecken, 2 Duschen, WC).

Die Unterkunft verfügt außerdem über eine Entspannungsecke. Babyausstattung steht zur Verfügung. Kostenloser WLAN-Zugang

Der Außenbereich lädt zur Entspannung und zum geselligen Beisammensein ein. Terrasse, Hof und Garten mit Bäumen und Lounge, Grill... Und sogar ein Bouleplatz für Amateure! Ebenfalls vor Ort: ein privater Flugplatz.

Das Ferienhaus ist mit dem Label "Tourisme et Handicap" (motorisch, auditiv, mental) ausgezeichnet und hat gerade den Zusatz zur Qualifikation Ecogestes des Labels "Gîte de France" ratifiziert.

en:
Welcome to the gîte d'En Lébé, in Touget, in the heart of Gascony, for a charming stay in the countryside

This large building of 290 m2, located on the farm, has been renovated according to the principles of "building with character"

With great comfort, you will appreciate the spacious and equipped living rooms: the large entrance hall, the living room with fireplace (with possible flames in winter), the independent kitchen and the laundry room with private washing machine...

The 5 rooms, all air-conditioned, can accommodate up to 17 people:
- the Chai (Tourism and Handicap label): two 90cm beds, private bathroom (sink, shower, toilet);
- the Reserve: a bed in 140, private sanitary (washbasin, shower, wc);
- the Poulailler: a bed in 140, private sanitary (washbasin, shower, independent WC);
- the Pigeonnier : one bed in 90 and one bed in 120;
- the Attic : eight beds in 90, private sanitary (4 washbasins, 2 showers, wc).

The gîte also has a relaxation area. Baby equipment available. Free Wifi access

The outside invites you to relax and enjoy. Terrace, courtyard and garden with its lounge, barbecue... And even a petanque ground for the amateurs! Also on site, a private airfield.

The gîte has been awarded the Tourism and Handicap label (motor, auditory, mental) and has just ratified the Ecogestes qualification rider of the Gîte de France label.

it:
Benvenuti al gîte d'En Lébé, a Touget, nel cuore della Guascogna, per un incantevole soggiorno in campagna

Questo grande edificio di 290 m2, situato nella fattoria, è stato ristrutturato secondo i principi del "costruire con carattere"

Con grande comodità, apprezzerete gli ambienti spaziosi e attrezzati: l'ampio ingresso, il soggiorno con camino (con possibili fiamme in inverno), la cucina indipendente e la lavanderia con lavatrice privata...

Le 5 camere, tutte climatizzate, possono ospitare fino a 17 persone:
- il Chai (marchio Turismo e Handicap): due letti da 90 cm, bagno privato (lavandino, doccia, wc);
- la Riserva: un letto di 140 cm, bagno privato (lavandino, doccia, wc);
- il Poulailler: un letto di 140 cm, bagno privato (lavandino, doccia, WC separato);
- il Pigeonnier: un letto su 90 e un letto su 120;
- mansarda: otto letti da 90 cm, servizi igienici privati (4 lavandini, 2 docce, wc).

Il gîte dispone anche di un'area relax. Attrezzatura per bambini disponibile. Accesso Wifi gratuito

L'esterno invita al relax e al divertimento. Terrazza, cortile e giardino con salone, barbecue... E persino un campo da bocce per i dilettanti! In loco è presente anche un campo di aviazione privato.

Il gîte ha ottenuto il marchio Turismo e Handicap (motorio, uditivo e mentale) e ha appena ratificato la qualifica Ecogestes del marchio Gîte de France.

fr:
Bienvenue au gîte d'En Lébé, à Touget, au coeur de la Gascogne, pour un séjour de charme à la campagne. 

Cette grande bâtisse de 290 m2, située sur l'exploitation agricole, a été rénovée selon les principes du "bâti de caractère". 

De grand confort, vous apprécierez les pièces à vivre spacieuses et équipées : le grand hall d'entrée, le salon avec cheminée (avec flambée possible l'hiver), la cuisine indépendante et la buanderie avec lave-linge privatif...

Les 5 chambres, toutes climatisées, permettent d'accueillir jusqu'à 17 personnes :
- le Chai (labellisé Tourisme et Handicap): deux lits en 90, sanitaires privés (lavabo, douche, wc);
- la Réserve : un lit en 140, sanitaires privés (lavabo, douche, wc);
- le Poulailler : un lit en 140, sanitaires privés (lavabo, douche, wc indépendants);
- le Pigeonnier : un lit en 90 et un lit en 120;
- le Grenier : huit lits en 90, sanitaires privés (4 lavabos, 2 douches, wc).

Le gîte dispose également d'un coin détente. Equipement bébé à disposition. Accès Wifi gratuit. 

Les extérieurs invitent à la détente et à la convivialité. Terrasse, cour et jardin arboré et son salon, barbecue... Et même un terrain de pétanque pour les amateurs ! Sur place également, un aérodrome privé.

Le gîte est labellisé Tourisme et Handicap (moteur, auditif, mental) et vient de ratifier l'avenant de qualification Ecogestes du label Gîte de France.

nl:
