- de reserve: een bed van 140 cm, eigen badkamer (wastafel, douche, wc);
- de Poulailler: een bed van 140 cm, eigen badkamer (wastafel, douche, aparte wc);
- de Pigeonnier: een bed in 90 en een bed in 120;
- de zolder: acht bedden van 90 cm, eigen sanitair (4 wastafels, 2 douches, wc).

