es:
Bienvenido a la casa rural d'En Lébé, en Touget, en el corazón de Gascuña, para una estancia con encanto en plena naturaleza

Este gran edificio de 290 m2, situado en la granja, ha sido renovado según los principios de la "construcción con carácter"

Con gran comodidad, apreciará los espacios amplios y equipados: el gran hall de entrada, el salón con chimenea (con posibles llamas en invierno), la cocina independiente y el lavadero con lavadora privada...

Las 5 habitaciones, todas con aire acondicionado, pueden alojar hasta 17 personas:
- el Chai (etiqueta Turismo y Handicap): dos camas de 90 cm, cuarto de baño privado (lavabo, ducha, wc);
- la Reserva: una cama de 140 cm, cuarto de baño privado (lavabo, ducha, wc);
- el Poulailler: una cama de 140 cm, cuarto de baño privado (lavabo, ducha, wc separado);
- el Pigeonnier : una cama de 90 y una cama de 120;
- el Ático: ocho camas de 90 cm, instalaciones sanitarias privadas (4 lavabos, 2 duchas, wc).

La casa rural también cuenta con una zona de relajación. Equipamiento para bebés disponible. Acceso Wifi gratuito

El exterior invita a relajarse y disfrutar. Terraza, patio y jardín con su salón, barbacoa... E incluso un campo de petanca para los aficionados También hay un aeródromo privado.

La casa rural ha obtenido la etiqueta Turismo y Discapacidad (motriz, auditiva y mental) y acaba de ratificar la calificación Ecogestes de la etiqueta Gîte de France.
